document.addEventListener('DOMContentLoaded', function() {
  // Handle event button clicks
  document.body.addEventListener('click', function(e) {
      const eventButton = e.target.closest('.event-button');
      
      if (eventButton) {
          e.preventDefault();
          // Find which event was clicked
          const eventCard = eventButton.closest('.event-card');
          const eventTitle = eventCard.querySelector('.event-title').textContent;
          
          // Find the event in our data
          let event;
          for (const category in eventsData) {
              event = eventsData[category].find(ev => ev.title === eventTitle);
              if (event) break;
          }
          
          if (event) {
              displayEventModal(event);
          }
      }
      
      // Handle modal close
      if (e.target.closest('.event-modal-close, .view-less-btn')) {
          closeEventModal();
      }
  });

  // Display event modal
  function displayEventModal(event) {
      const outcomesList = event.outcomes?.map(item => `<li>${item}</li>`).join('') || '';

      const hasInsta = event.insta && event.insta.trim() !== '#' && event.insta.trim() !== '';
   const hasLinkedIn = event.linkedin && event.linkedin.trim() !== '#' && event.linkedin.trim() !== '';
 
   // Generate social buttons only if links exist
   const instaButton = hasInsta
     ? `<a href="${event.insta}" target="_blank" class="social-link instagram">
                      <i class="fab fa-instagram"></i> Instagram
                  </a>`
     : '';
 
   const linkedinButton = hasLinkedIn
     ? `<a href="${event.linkedin}" target="_blank" class="social-link linkedin">
                      <i class="fab fa-linkedin"></i> LinkedIn
                  </a>`
     : '';
      
      const modalHTML = `
      <div class="event-modal-overlay">
          <div class="event-modal">
              <button class="event-modal-close">&times;</button>
              
              <div class="event-modal-header">
                  <img src="${event.thumbnail}" alt="${event.title}" class="event-modal-thumbnail">
                  <h2 class="event-modal-title">${event.title}</h2>
              </div>
              
              <div class="event-details-container">
                  <div class="event-detail">
                      <i class="fas fa-calendar-alt"></i>
                      <span>${event.date}</span>
                  </div>
                  
                  <div class="event-detail">
                      <i class="fas fa-clock"></i>
                      <span>${event.time}</span>
                  </div>
                  
                  <div class="event-detail">
                      <i class="fas fa-map-marker-alt"></i>
                      <span>${event.location}</span>
                  </div>
              </div>

              <div class="event-description">
                  <h3>Description</h3>
                  <p>${event.description || "No description available."}</p>
              </div>

              <div class="event-outcomes">
                  <h3>Outcomes</h3>
                  <ul>${outcomesList}</ul>
              </div>
              
              <div class="event-social-links">
              ${instaButton}
              ${linkedinButton}
              </div>
              
              <button class="view-less-btn">${event.linkText === 'Know More' ? 'View Less' : 'Close'}</button>
          </div>
      </div>
      `;
      
      document.body.insertAdjacentHTML('beforeend', modalHTML);
      document.body.style.overflow = 'hidden';
  }

  function closeEventModal() {
      const modal = document.querySelector('.event-modal-overlay');
      if (modal) {
          modal.remove();
          document.body.style.overflow = '';
      }
  }
});















// Function to render events
function renderEvents() {
  const recentEventsContainer = document.getElementById("recent-events");
  const upcomingEventsContainer = document.getElementById("upcoming-events");

  // Clear existing content
  recentEventsContainer.innerHTML = "";
  upcomingEventsContainer.innerHTML = "";

  // Add recent events
  eventsData.recent.forEach((event) => {
    recentEventsContainer.innerHTML += createEventCard(event);
  });

  // Add upcoming events
  eventsData.upcoming.forEach((event) => {
    upcomingEventsContainer.innerHTML += createEventCard(event);
  });

  // Start title animations
  startTitleAnimations();

  // Initialize intersection observer
  initIntersectionObserver();
}

// Function to handle title animations
function startTitleAnimations() {
  const titleContainers = document.querySelectorAll(".event-title-container");

  titleContainers.forEach((container) => {
    const title = container.querySelector(".event-title");
    const containerWidth = container.offsetWidth;
    const titleWidth = title.offsetWidth;

    // Only animate if text is longer than container
    if (titleWidth > containerWidth) {
      const duration = (titleWidth / 50) * 1000; // Adjust speed based on text length
      title.style.animationDuration = `${duration}ms`;
    } else {
      title.style.animation = "none";
    }
  });
}

// Initialize intersection observer for scroll animations
function initIntersectionObserver() {
  const observerOptions = {
    threshold: 0.1,
  };

  const observer = new IntersectionObserver((entries) => {
    entries.forEach((entry) => {
      if (entry.isIntersecting) {
        entry.target.classList.add("animate");
      }
    });
  }, observerOptions);

  document.querySelectorAll(".event-card").forEach((card) => {
    observer.observe(card);
  });
}

// Initialize when DOM is loaded
document.addEventListener("DOMContentLoaded", () => {
  renderEvents();

  // Recalculate animations on resize
  window.addEventListener("resize", () => {
    startTitleAnimations();
  });
});
